#' generate html file
#'
#' @param prediction result matrix using all exons and RBP-specific exons 
#'
#' @return 
#' @export
#'
#' @examples
output2html <- function(content, file = "index.html", append = TRUE) {
    if (file != "none") {
        cat(content, "\n", file = "index.html", append = append)
    }
}

